export default {
  name: 'ImportResult',
  props: {
    dialogVisible: {
      type: Boolean,
      default: false
    },
    time: {
      type: String,
      default: '0 ms'
    },
    data: {
      type: Array,
      default: () => {
        return []
      }
    },
    error: {
      type: Array,
      default: () => {
        return []
      }
    }
  },
  data() {
    return {
      activeName: 'first',
      screenWidth: 0,
      width: this.initWidth(),
      success: {
        pagination: {
          size: 5,
          num: 1
        }
      }
    }
  },
  computed: {
    errorsData() {
      const arr = []
      for (let i = 0; i < this.error.length; i++) {
        const err = this.error[i]
        let e = {}
        for (const field of err.errorFields) {
          e = { ...field }
          e.row = err.row
          arr.push(e)
        }
      }
      return arr
    },
    isVisible: {
      get() {
        return this.dialogVisible
      },
      set() {
        this.close()
      }
    }
  },
  mounted() {
    window.onresize = () => {
      return (() => {
        this.width = this.initWidth()
      })()
    }
  },
  methods: {
    close() {
      this.$emit('close')
    },
    initWidth() {
      this.screenWidth = document.body.clientWidth
      if (this.screenWidth < 991) {
        return '90%'
      } else if (this.screenWidth < 1400) {
        return '70%'
      } else {
        return '1000px'
      }
    }
  }
}
